import React from 'react';
import './Prisoner.css';

const Prisoner = props => {
    return (
        <div className="prisoner-container">
            <h3>{props.name}</h3>
            <p>{props.skills}</p>
            <p>{props.availability}</p>
        </div>
    )
};

export default Prisoner;
